function checkBoxValue() {

        var text_value = document.getElementById("search").value;
        var text_value_2 = "On this input keyword";

        text_value = text_value.replace("%", "").replace("&", "").replace("*", "");
        if (text_value == text_value_2 || text_value == "") {
            alert("On this input keyword");
            return false;
        }
    }

