                        function checknum() {
                            var qu = document.getElementById("txtquantity");
                            if (isNaN(qu.value)) {
                                alert("S'il vous plaît d'entrée numérique!");
                                qu.focus();
                                return false;
                            }
                            else {
                                if (qu.value == 0 || qu.value == "") {
                                    alert("S'il vous plaît d'entrée numérique!");
                                    return false;
                                }
                                else {
                                    return true;
                                }
                            }
                        }

